import React from "react";

function RatingButton({title, radioValue}) {
  return (
    <div className="p-3">
      <div>
        <span className="title text-lg font-bold">{title}</span>
      </div>
      <div>
        <input type="radio" value={radioValue} name="radioBtn" className="w-4 h-4 accent-red-600 outline-8" />
        {/* <span className="p-3">{radioValue}</span> */}
      </div>
    </div>
  );
}

export default RatingButton;
